import React from 'react'
import Navbar from "./componants/Navbar";
import News from "./componants/News";
import LoadingBar from "react-top-loading-bar"

function App() {
  const pageSize = 5;
  const [progress, setProgress] = useState(0)

  return (

     <>
       <Navbar />
       <LoadingBar
        height={3}
        color='#f11946'
        progress={progress} 
      />
       <News setProgress={setProgress} apiKey="3073ba38fd224c87baa5a828e12acb08" key="general" pageSize={pageSize} country="in" category="general"/>
     </>
  );
}

export default App;
